import Meta from './Meta';
import Header from './Header';
import styled from '@emotion/styled';

// Styles
const Global = styled.div`
  font-family: Arial, Helvetica, sans-serif;
  background-color: honeydew;
  color: seagreen;
  position: absolute;
  height: 100%;
  width: 100%;
`;

const Layout = styled.div`
`;

const Page = (props) => (
  <Global>
    <Meta />
    <Header />
    {props.children}
  </Global>
);

export default Page;
